import './Navigation.css';

function Navigation() {
  return (
    <nav>
      <h2 className="logo" > My portfolio </h2>
      <ul>
        <li> <a href=""></a>Home </li>
        <li> About </li>
        <li> Contact </li>
      </ul>
    </nav>
  );
}

export default Navigation;
